import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../public/logo.jpg';

const Header = () => {
    return (
        <header>
            <div className="logo">
                <img src={logo} alt="Logo" />
            </div>
            <nav>
                <Link to="/">Inicio</Link>
                <Link to="/cart">Carrito</Link>
                <Link to="/products">Productos</Link>
            </nav>
        </header>
    );
}

export default Header;
